30\u043d\u0435\u043d\u0438\u0435 \u0441\u0442\u0430\u0442\u0443\u0441\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u043a\u043e\u043b\u043e\u043d\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u0433\u043e\u0434\u0430 \u043f\u043b\u0435\u043d\u0430 \u044d\u043a\u0438\u043f\u0430\u0436 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%80%D0%BF%D0%B0%D1%82%D0%BE%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u0428\u0430\u0440\u043f\u0430\u0442\u043e\u0432, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0418\u043b\u044c\u0438\u0447\">\u0412. \u0428\u0430\u0440\u043f\u0430\u0442\u043e\u0432\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D1%85%D0%B2%D0%B0%D1%82_%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82%D0%B0_%D0%98%D0%BB-76_3_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0_1995_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u0417\u0430\u0445\u0432\u0430\u0442 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0418\u043b-76 3 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 1995 \u0433\u043e\u0434\u0430\">\u043f\u0440\u0438\u043d\u0443\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u043e\u0441\u0430\u0436\u0435\u043d\u043d\u043e\u0433\u043e<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D0%B4%D1%80%D0%BE%D0%BC\" title=\"\u0410\u044d\u0440\u043e\u0434\u0440\u043e\u043c\">\u0430\u044d\u0440\u043e\u0434\u0440\u043e\u043c<\/a> \u0432\u0431\u043b\u0438\u0437\u0438 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B4%D0%B0%D0%B3%D0%B0%D1%80\" title=\"\u041a\u0430\u043d\u0434\u0430\u0433\u0430\u0440\">\u041a\u0430\u043d\u0434\u0430\u0433\u0430\u0440<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD